import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import deleteUser from './DeleteUser';
import axios from 'axios';


export default function AllUser(){


    const [user, setUser] = useState([]);

    const getUser = () => {
        axios.get('http://localhost:6060/User/')
        .then((res) => {
            console.log(res.data);
            setUser(res.data);
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

  

  useEffect(() => {
    getUser();
    
  }, []);

    const handleDelete = (userId) => {
        deleteUser(userId)
          .then(() => {
            alert('Vehicle deleted successfully');
            getUser();
          })
          .catch((err) => {
            alert('Vehicle not deleted: ' + err);
          });
      };
    
    return (
        <div style={{ overflowX: 'auto',padding: '20px', marginLeft:'125px' ,alignItems:'center' }}>
        <h1 style={{ alignItems:'center', color:"#808080"}}>All Users</h1>
        <div style={{ overflowX: 'auto', marginLeft: '130px', maxHeight: '500px' }}>
          <table style={{ borderCollapse: 'collapse', width: '100%', border: '1px solid #ddd', borderRadius: '5px' }}>
            <thead style={{ backgroundColor: '#f0f0f0', borderBottom: '2px solid #ddd' }}>
              <tr >
                <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Email</th>
                <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Name</th>
                <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Address</th>
                <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Gender</th>
                <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Contact No</th>
                <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>View</th>
                <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Delete</th>
                <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Update</th>
              </tr>
            </thead>
            <tbody style={{ maxHeight: '500px' }}>
              {user.map((u, index) => (
                <tr key={index} style={{ borderBottom: '1px solid #ddd' }}>
                  <td style={{ padding: '4px' }}>{u.email}</td>
                  <td style={{ padding: '4px' }}>{u.name}</td>
                  <td style={{ padding: '4px' }}>{u.address}</td>
                  <td style={{ padding: '4px' }}>{u.gender}</td>
                  <td style={{ padding: '4px' }}>Rs: {u.contactno}</td>
                  <td style={{ padding: '5px', textAlign: 'center' }}>
                    <a className="nav-link" href={`/get/${u._id}`}>
                      <img
                        src={`http://localhost:6060/images/eye.png`}
                        alt={`${index}`}
                        style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer' }}
                      />
                    </a>
                  </td>
                  <td style={{ padding: '5px', textAlign: 'center' }}>
                    <img
                      src={`http://localhost:6060/images/delete.png`}
                      alt={`${index}`}
                      style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer', marginRight: '5px' }}
                      onClick={() => handleDelete(u._id)}
                    />
                  </td>
                  <td style={{ padding: '5px', textAlign: 'center' }}>
                    <a className="nav-link" href={`/update/${u._id}`}>
                      <img
                        src={`http://localhost:6060/images/edit.png`}
                        alt={`${index}`}
                        style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer' }}
                      />
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    )
}
